import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

// Importation des modules Angular Material
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

// Importation des composants
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './components/header/header.component';
import { FooterComponent } from './components/footer/footer.component';
import { BannerComponent } from './pages/accueil/banner/banner.component';
import { EventCardComponent } from './components/event-card/event-card.component';
import { ArtistCardComponent } from './components/artist-card/artist-card.component';
import { MapInteractiveComponent } from './components/map-interactive/map-interactive.component';
import { TestimonialSliderComponent } from './components/testimonial-slider/testimonial-slider.component';
import { PartnerCardComponent } from './components/partner-card/partner-card.component';
import { MediaCardComponent } from './components/media-card/media-card.component';
import { ContactFormComponent } from './components/contact-form/contact-form.component';
import { AccueilComponent } from './pages/accueil/accueil.component';
import { EvenementsComponent } from './pages/evenements/evenements.component';
import { ArtistesComponent } from './pages/artistes/artistes.component';
import { MediathequeComponent } from './pages/mediatheque/mediatheque.component';
import { PartenairesComponent } from './pages/partenaires/partenaires.component';
import { ContactComponent } from './pages/contact/contact.component';
import { DashboardComponent } from './admin/dashboard/dashboard.component';
import { LoginComponent } from './admin/login/login.component';
import { StatistiquesComponent } from './admin/statistiques/statistiques.component';
import { ContenuAccueilComponent } from './pages/accueil/contenu-accueil/contenu-accueil.component';
import { PromotionBannerComponent } from './pages/accueil/promotion-banner/promotion-banner.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    BannerComponent,
    EventCardComponent,
    ArtistCardComponent,
    MapInteractiveComponent,
    TestimonialSliderComponent,
    PartnerCardComponent,
    MediaCardComponent,
    ContactFormComponent,
    AccueilComponent,
    EvenementsComponent,
    ArtistesComponent,
    MediathequeComponent,
    PartenairesComponent,
    ContactComponent,
    DashboardComponent,
    LoginComponent,
    StatistiquesComponent,
    ContenuAccueilComponent,
    PromotionBannerComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule,  // Ajout du module d'animations
    MatIconModule,  // MatIconModule importé
    MatButtonModule // MatButtonModule importé
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
